import React from "react";
import "./homenav.css";
import logo from "../img/homelogo.png";
import { Link, NavLink } from "react-router-dom";
 function Homenav(){
    return(
        <>
         <nav>
            <div>

                <ul>

                    <li> <Link>
                       <div className="homelogo">
                       <img src={logo}/>
                        </div>
          </Link></li>
                </ul>
            </div>
         

          <NavLink>

          </NavLink>

         

         </nav>
        </>
    );
 }
 export default Homenav;
